description:
Het verhaal begint als ergens ver weg de arme schoenmaker Hans is toegekomen aan zijn laatste armzalige stukje leer. Maar, ongelukkig genoeg voor Hans, zijn er vier elfjes-in-opleiding in de buurt. Zij moeten nog een goede daad verrichten om zich volleerde elfen te mogen noemen. Terwijl Hans die nacht ligt te slapen, lappen de elfjes een schitterend paar schoenen. De volgende dag verkoopt Hans het paar prompt aan de ijdele koning, die helemaal gek is van schoenen. 

